function dictSearch(day, time, sem, year, breadth) {
	console.log("dictSearching!");
    var resultc = [];
	for (var slot in schedule) {
		if (slot.contains(day)) {
			if (slot.contains('-')) {
				var starttime = slot.slice(0,slot.indexOf('-'));
			}
			else {
				var starttime = slot;
			}
			var cindex = 0;
			for (var i = 0, len = starttime.length; i < len; i++) {
				if (isNumeric(starttime[i])) {
					cindex = starttime.indexOf(starttime[i]);
					break;
				}
			}
			hour = starttime.slice(cindex);
			if (hour == time) {
				for (var i = 0, len = schedule[slot].length; i < len; i++) {
					var course = schedule[slot][i];
					if (course[course.length-1] == sem) {
						resultc.push(course);
					}
				}
			}
		}
	}
	console.log("RESULTC = " +resultc);
	return fives(filterB(filtery(resultc, year), breadth));	
}

