/*
Description: Generate an integer Array containing an arithmetic progression. A port of
the native Python `range()` function. 
Input: 2 integer arguments
Output: Integer array of elements between start and stop
*/
function range (start, stop) {

	var range = [];

	for (x=start; x<stop; x++) {
		range.push(x);
	}
	return range;
}

/*
Description: Determine if given string represents a day of the week
Input: str (with length 1)
Output: Boolean
--
> isday ('A');
False
> isday ('M');
True
*/
function isday (s){ 

	var days = 'MTWRFS';
	return days.match(s);
};

/*
Description: Split up a string representation of class times into a list of 
individual days and hours
Input: str 
Output: Array of str
--
> split_time ('MWF10');
['M10', 'W10', 'F10']

> split_time ('R8');
['R8']

> split_time ('W6-9');
['W6', 'W7', 'W8']
*/
function split_time(s){
	
	var return_list = [];
	s = s.split('(');
	s = s[0].trim();
	var index = 0;
	while (isday(s[index])) {
		index += 1;
	}

	var day = s.substring(0,index);
	var hour = s.substring(index);
	
	//multiple day single hour class
	if (hour.match('-') == null) {
		//console.log("BIG IF");
		for (x=0; x<day.length;x++) {
			return_list.push(day[x]+hour);

		}
	}

	
	else {
		//console.log("BIG ELSE");
		var hour_split = hour[0];
		var hour_end = hour[hour.length-1];
		hour_split = parseInt(hour_split);
		hour_end = parseInt(hour_end);
		
		var hourly = '';
		var hours_sep = range(hour_split, hour_end);
		for (i in hours_sep) {
			hourly = hourly + hours_sep[i];
		}

		for (x=0; x<day.length; x++) {
			//console.log(x);
			for (h=0; h<hourly.length; h++) {
			//	console.log(h);
			//	console.log()
				return_list.push(day[x]+hourly[h]);
			}
		}
	}

	//console.log(return_list);
	return return_list;
	
};

